import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {

  return (
  <BrowserRouter>
  <Routes>
<Route path='/' element={<div>home page</div>}  />
<Route path='about' element={<div>about it </div>}    />
  </Routes>
  </BrowserRouter>

  );}
function Aout () {}
export default App;
